import React from 'react'

const Navbar = ({ filterValue, catData}) => {
    return (
        <>
         <div className="navigation">
      <div className="nav-btn-group">
      {
          catData.map((crnElem) =>{
              return(

        <button className="navbtn" onClick={() => filterValue(crnElem)}>{crnElem}</button>
              )
          })
      }
        
       
      </div>
    </div>
    
        </>
    )
}

export default Navbar;
